import React from "react";

function MemberItem({ image, name, position }) {
    return (

        <div className="menuItem">
            <div style={{ backgroundImage: `url(${image})`,
                objectFit:"cover",
                height: 45,
                borderRadius:50,
                marginRight: 2 }}> </div>
            <div className="menuDetail" style={{height:100, borderRadius:15}}>
                <h2> {name} </h2>
                <h3> {position} </h3>
            </div>
        </div>
    );
}

export default MemberItem;
